import {React} from 'react'
import { useParams } from 'react-router-dom'
import blogs from "../blog.json"

export default function Test() {
    let {id}=useParams();
    id=parseInt(id);
    const blog=blogs.find(item=>item.id===id)
    return(
        
        <div className='bg-[#8e41b0] h-screen '>
            <h1>{blog.tite}</h1>
            <p>{blog.content}</p>
        </div>
    )
}
